import '../css/one.css'

const One = () =>{
    return(
        <div className="one-background">
            <div className="box-image">
            <img className="handsomeImage" src="https://wallpapercave.com/wp/wp1981970.jpg"></img>
                <div className="prop prop-1"></div>
                <div className="prop prop-2"></div>
                <div className="prop prop-3"></div>
            </div>
            <div className="box-description"></div>
        </div>
    );

}

export default One;
